import React, { useEffect, useState } from "react";
import styled from "styled-components";
import { getREM } from "../../constants/styles/utils";
import { theme } from "../../constants/styles/theme";
import { ReactComponent as CloseIcon } from "../../assets/icons/close.svg";
import Icon from "../Icon";
import PDFTron from "../PDFTronViewer";

interface ExhibitsProps {
    visible: boolean;
    onClick?: () => void;
}

interface StyledContainerProps extends Pick<ExhibitsProps, "visible"> {}

export const StyledContainer = styled.div<StyledContainerProps>`
    display: flex;
    flex-direction: column;
    height: 100%;
    flex: 1 1 0%;
    padding: ${({ theme }) => getREM(theme.default.spaces[3])};
    margin-right: ${({ theme }) => getREM(theme.default.spaces[3])};
    border-radius: ${({ theme }) => getREM(theme.default.borderRadiusBase)};
    overflow: hidden;
    background: ${({ theme }) => theme.colors.inDepoNeutrals[6]};
    ${({ visible }) => {
        return `
            visibility: ${visible ? "visible" : "hidden"};
            position: ${visible ? "static" : "absolute"};
            left: ${visible ? "0" : "-9999px"};
        `;
    }}
`;

const StyledHeader = styled.div`
    display: flex;
    justify-content: space-between;
    flex-direction: row-reverse;
    width: 100%;
    padding-bottom: ${({ theme }) => getREM(theme.default.spaces[3])};
`;

const StyledContent = styled.div`
    flex: 1 0 0%;
`;

const Exhibits = ({ visible, onClick }: ExhibitsProps) => {
    const blobPDFFromBase64String = (base64String) => {
        const byteArray = Uint8Array.from(
            atob(base64String)
                .split("")
                .map((char) => char.charCodeAt(0))
        );
        return new Blob([byteArray], { type: "application/pdf" });
    };

    const [file, setFile] = useState(null);

    useEffect(() => {
        // TODO: Replace this with real PDF file
        const PDFFile = blobPDFFromBase64String(
            ""
        );
        setFile(PDFFile);
    }, []);

    return (
        <StyledContainer visible={visible}>
            <StyledHeader>
                <Icon icon={CloseIcon} onClick={onClick} style={{ color: theme.default.whiteColor }} />
            </StyledHeader>
            <StyledContent>
                <PDFTron filename="myfile.pdf" document={file} />
            </StyledContent>
        </StyledContainer>
    );
};

export default Exhibits;
